import React, { Fragment } from "react";
import { Paper } from "@mui/material";

const Post = ({ posts }) => {
    return (
        <div>
        {
            posts.map((post) => {
                const { description, location, price, title, _id } = post
                return (
                    <Paper
                    variant="e"

                    >
                    <Fragment>
                    <div key={_id}>
                        <h3>{title}</h3>
                        <p>Description: {description}</p>
                        <p>Price: {price}</p>
                        <p>Location: {location}</p>
                    </div>
                    </Fragment>
                    </Paper>
                )
            })
        }
        </div>
    )
}

export default Post
